var arr = ['a', 'A', 'b', 'B', 'c', 'C'];
I want to sort it like this:
['A', 'a', 'B', 'b', 'C', 'c']
I tried this:
arr.sort(function(a, b) {
    return a.toLowerCase() > b.toLowerCase();
but it doesn't work. It sorts like this:
['A', 'a', 'B', 'b', 'C', 'c']
How can I sort it in case-sensative order?
